    //       <Route path="/dashboard/mainpage" element={<RouteAuthenticated> <MainPage /> </RouteAuthenticated>} />
    //     <Route path="/dashboard/test" element={<Test />} />
    //   </Routes>
    // </>
    <>
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/dashboard" element={ <Dashboard /> } />
      <Route path="/dashboard/investments" element={<Investments /> } />
      <Route path="/dashboard/inventory" element={ <Inventory /> } />
      <Route path="/dashboard/tracker" element={ <Tracker /> } />
      <Route path="/dashboard/mainpage" element={ <MainPage />} />
    </Routes>
  </>
  );
}

export default App;
